function DessertsList(props) {
  const listItems =  props.map(dessert => {
        const itemText = `${dessert.title} - ${dessert.price}`;
        return <li>{itemText}</li>;
    });
  return <ul>{listItems}</ul>;
}

export default DessertsList;
